import React from "react";
import "./scss/admin.css";
import { useHistory } from "react-router-dom";
import { Button } from "@material-ui/core";

export default function Admin() {
  const history = useHistory();

  return (
    <div>
      <Button
        button
        onClick={() => {
          history.push("./moviemanagement");
        }}
        label="Item One"
      >
        Movie
      </Button>
      <Button
        button
        onClick={() => {
          history.push("./clientmanagement");
        }}
      >
        Client
      </Button>
      <Button
        button
        onClick={() => {
          history.push("/admin");
        }}
      >
        Admin
      </Button>
    </div>
  );
}
